import Dashboard from "./dashboard";
import Garage from "./carsList";
import Login from "./login";
import './App.css'

function App() {
  let username = "jeeva"
  let password = 'jeeva123'
  let isLogin = true
  if (isLogin) {
    return <Login />
  } else {
    return (<div>
      <Dashboard username={username} password={password} />
      <Garage />
    </div>)
  }
}

export default App;
